import React from "react"
import { deleteJobs } from "../utils/api"


function Jobs (job){
if(job.length){
   return job.map((job, index) => {
      return (
      <>
         <ul>
            <li key={index}>
               <p>{job.neighborhood}</p>
               <p>{job.picture}</p>
               <p>{job.worker}</p>
               <p>{job.date}</p>
            </li>
            <button onClick={() => deleteJobs()}>Delete</button>
         </ul>
      </>
         )
   })
      
   }
      
}
    export default Jobs
